s0&nl&ss0I made a funny prank with Edie, where I took her skin and forged it with a minecraft girl wearing a wedding dress&dot Then I created a big wedding area and asked her to ptp to me, then I put on|&quoHere Comes The Bride&quo Music and started walking down the aisle, it was so funny and we had a great laugh out if it&dot In the end, me Alex_The_Better and Edie all used a bit of tnt and blew the ceremony up XD|===================#3   Ranked Up&exc&ss0&nl&ss0===================Today a lot of people got ranked up&exc Jazzy is now a builder, Edie is now a Veteran, and then there are a bunch of other people who got ranked up to MB and stuff like that&exc I sadly didnt get &ss0Jr&dotBuilder&ss0 |but maybe next time &co3 I am working really hard to impress Bruno so that I can become it&dot Hopefully I can be soon &lt3|===================#4  Shipping Shrine&ss0&nl&ss0===================Me and dog1234 made a shipping shrine for Edie and Alex as a joke&exc Of course they both found it&dot Edie didnt really mind it, and Alex wanted to blow it up, but he didnt&exc CX Anyways, it was fun 2 mak|===================#5   The New House&ss0&nl&ss0===================I have made a base in the adventure world, then bruno wanted everyone to move to the Wild world, as told&dot I did&exc I made a secret base that didnt look that great&dot Me Carly9694, Bailey1359, and Edie|made our bases near each other, then edie moved her base somewhere else&dot And since I hated where I lived, I moved in with her&dot I now live with Edieroads, Nerdy_cake0125, Alex_The_Better, NoahPlays2, and maybe CoolWildBubba&exc Maybe Jazzy but idk yet&dot|===================#6 When I First Joined ===================I joined Brunosrealm on 02&fs29&fs16 Which was only 3 months ago because right now it is 05&fs28&fs16&dot This server got reffered to me by dog1234 an AWESOME friend of mine &lt3 That day when she gave me |the server address&dot I had no idea how much this would change my life&dot When I joined I saw some1 named dog1234 and didnt know who they were, they helped me out a little bit, and then asked me&co Wait, legoeva do I know you&dot Right then I knew who she was&dot|We play together a lot now, not always on Brunosrealm but usually on minecraft in general&dot Brunosrealm has changed my life so much, new friendships, new goals, and expessially, it has made me into a better person&dot It had made me less shy and more outgoing|===================#7 Discord Server&ss0&nl&ss0===================I found a website called discord, that bruno joined for the server so that people who dont have minecraft, can still talk with the community&dot I made a chat on there and a lot of my good friends on|brunosrealm are on it&dot We have the funniest of moments on there and I am glad I found out about Discord, it has really helped me become less shy, and happier to make new friends&dot I still am not 100% comfortable with talking alone with randoms, but I do|love talking with at least 2 people&dot Even if i dont know them IRL&dot It feels like ive known them my entire life &lt3&ss0&nl&ss0&nl&ss0&co3 ~Eggo&ss0&nl&ss0&nl&ss0Oh yeah &atEdieroads gave me the nickname Eggo XDDD|===================#8 A Cookietastrophy&ss0&nl&ss0===================I needed lots of lvls to get more vitality (Hearts) So i went to the &fswarps &gt&gt Quests &gt&gt Hero School&dot And killed lots of orcs, which is how I got this book&dot I accidently clicked a pressure |plate and got teleported to the farm&fsbeggining, so I farmed some wheat for a while&dot When I got back home I thought it would be nice to make some cookies, because why not&exc But I forgot that 2 wheat and 1 cocoa beans = 8 cookies, I thought it made 1&exc So I|shift clicked the result which was 64 wheat, 64 cocoa beans and 64 more wheat&dot and got A LOT&exc Of cookies&dot Eventually I accidently made an ENTIRE double chest full of cookies&dot That was my mistake, but at least now&dot We will won&sqt need food for a Loongg Time|==========